import React from 'react';
import { useSelector } from 'react-redux';
import './Account.css';
import store from './redux/Store';

function Account() {
  const transactions = useSelector((state) => state.transactions);
  const users = useSelector((state) => state.users);
  const [selectedUser, setSelectedUser] = React.useState(users[0].id);

  // Helper function to calculate active and consumed tokens for the selected user
  const getUserTokens = (userId) => {
    const userTransactions = transactions.filter((tx) => tx.userId === userId);
    const userTokens = {};
    userTransactions.forEach((tx) => {
      if (tx.type === 'Buy Token') {
        if (!userTokens[tx.stock]) {
          userTokens[tx.stock] = { active: tx.amount, consumed: 0 };
        } else {
          userTokens[tx.stock].active += tx.amount;
        }
      } else if (tx.type === 'Buy Stock') {
        if (userTokens[tx.stock]) {
          userTokens[tx.stock].consumed += tx.amount;
          userTokens[tx.stock].active -= tx.amount;
        }
      }
    });
    return userTokens;
  };

  // Calculate active and consumed tokens for the selected user
  const userTokens = getUserTokens(selectedUser);

  // Map over the calculated tokens to create rows for the tables
  const activeTokensRows = Object.entries(userTokens)
    .filter(([stock, { active, consumed }]) => active > 0)
    .map(([stock, { active }], index) => (
      <tr key={index}>
        <td>{selectedUser}</td>
        <td>Active Token</td>
        <td>{stock}</td>
        <td>{active}</td>
        <td>-</td>
      </tr>
    ));

  const consumedTokensRows = Object.entries(userTokens)
    .filter(([stock, { consumed }]) => consumed > 0)
    .map(([stock, { consumed }], index) => (
      <tr key={index}>
        <td>{selectedUser}</td>
        <td>Consumed Token</td>
        <td>{stock}</td>
        <td>{consumed}</td>
        <td>-</td>
      </tr>
    ));

  return (
    <div className="account-page">
      {/* ... other parts of the component ... */}
      <div className="transactions-table">
        <h2>Active Tokens</h2>
        <table>
          <thead>
            <tr>
              <th>User ID</th>
              <th>Type</th>
              <th>Stock</th>
              <th>Amount</th>
              <th>Timestamp</th>
            </tr>
          </thead>
          <tbody>{activeTokensRows}</tbody>
        </table>
        <h2>Consumed Tokens</h2>
        <table>
          <thead>
            <tr>
              <th>User ID</th>
              <th>Type</th>
              <th>Stock</th>
              <th>Amount</th>
              <th>Timestamp</th>
            </tr>
          </thead>
          <tbody>{consumedTokensRows}</tbody>
        </table>
      </div>
    </div>
  );
}

export default Account;
